import React from "react";

const EpisodesListCharacter: React.FC<{ episode: any, locations: any }> = ({ episode, locations }) => {
    console.log(episode);
    console.log(locations);

    return (
        <div>
            {episode.origin}
            <ul>
                {episode.characters.map((character: any) => (
                    <li>{`${character?.name} (${character?.id}) (${character?.origin.name})`}</li>
                ))}
            </ul>
        </div>
    );
};

export default EpisodesListCharacter;
